import React from 'react';
import ReactDOM from 'react-dom';
import Welcome from './ES6Clare';
// import Container from './PersonCenter/PersonCenter.jsx';
// import Container from './GoodsDetails/gooddetails';
// import Container from './GoodsDetails/rotate/test'
import Container from './PersonCenter/drawer';
// import Container from './GoodsDetails/Tabs';

import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from 'react-router-dom';

function RootRouter() {
  return (
      <Router>
      <Switch >
        <Route exact path="/" children={<Welcome />} />
        <Route path="/PersonCenter">
          <Container />
        </Route>

      </Switch>      
      </Router>
  );
}

class hy extends React.Component{
  componentWillMount () {
    // loading 动画 的结束 控制 模块
    let loading = document.getElementById('food')
    if (loading) {
      loading.setAttribute('class', 'i-loading-out')
      setTimeout(() => {
        loading.style.display = 'none'
      }, 1000)
    }
  }


  render(){
    return(<RootRouter />)


  };
}
ReactDOM.render(<hy />, document.getElementById('food'));
